description:
Verenigde Staten
Mystery / Thriller
130 minuten

een mooie film

met Kristen Stewart, Robert Pattinson en Taylor Lautner

Nadat Bella herstelt van een vampieraanval, die haar bijna van het leven beroofde, viert ze haar verjaardag bij Edward en zijn 
familie. Een ongelukje zorgt er echter voor dat Bella begint te bloeden, iets wat voor de familie van Edward onverdraaglijk is, 
aangezien hun dorst naar het bloed van Bella iets is wat er altijd zal blijven. Edward en zijn familie besluiten Bella hierdoor 
alleen te laten in deze periode, iets wat beter voor iedereen lijkt te zijn. De eerst diepbedroefde Bella vindt troost bij Jacob 
Black, waar ze een vriendschap mee opbouwt. Het lijkt allemaal weer beter te gaan, maar Bella weet niet dat er hierdoor alleen 
maar nieuwe gevaren op de loer komen te liggen...
